import './Section9.css';
import Container from 'react-bootstrap/Container';
import Row from 'react-bootstrap/Row';
import Col from 'react-bootstrap/Col';
import { ArrowRepeat, ArrowRight } from "react-bootstrap-icons";
function Section10(){
    return(
<Container className="Section4">
<Row >
        <Col sm={8}>
        <div class="col-3 rw-5-c-1">


<div class="company-1">
  <h1 class="anchor">About us</h1>
  <a href="#" class="anchor">Team</a>
  <a href="#" class="anchor">Careers</a>
  <a href="#" class="anchor">swiggy Blog</a>
  <a href="#" class="anchor">Bug Bounty</a>
  <a href="#" class="anchor">Swiggy One</a>
  <a href="#" class="anchor">Swiggy Corporate</a>
  <a href="#" class="anchor">Swiggy Instament</a>
  <a href="#" class="anchor">Swiggy Genie</a>
  <a href="#" class="anchor">Swiggy HDFC Bank Credit Card</a>
</div>
</div></Col>

</Row>
</Container>

    );
}
export default Section10;
